import React from 'react';
import { Link } from 'react-router-dom';

export default function Navbar() {
  return (
    <nav className="bg-gray-800 py-3 px-6 flex justify-between items-center shadow-md">
      <h1 className="text-primary font-bold text-xl">Smart Expense</h1>

      <div className="flex space-x-4">
        <Link to="/" className="text-gray-300 hover:text-primary">Dashboard</Link>
        <Link to="/add" className="text-gray-300 hover:text-primary">Add Expense</Link>
        <Link to="/budget" className="text-gray-300 hover:text-primary">Budget</Link>
        <Link to="/reports" className="text-gray-300 hover:text-primary">Reports</Link>
      </div>
    </nav>
  );
}
